ottom: 4rem;\n            text-align: center;\n        }\n        \n        .services-title {\n            display: flex;\n            align-items: center;\n            justify-content: center;\n            gap: 1rem;\n            margin-bottom: 2rem;\n        }\n        \n        .services-title h1 {\n            font-size: 4rem;\n            font-weight: 800;\n            color: #000;\n            margin: 0;\n        }\n        \n        .plus-icon {\n            color: #2E7D32;\n            font-size: 3rem;\n            font-weight: 300;\n            margin-left: 1rem;\n        }\n        \n        .services-description {\n            max-width: 800px;\n            margin: 0 auto;\n            color: white;\n            font-size: 1.8rem;\n            line-height: 1.6;\n            font-weight: 600;\n            text-align: center;\n            background: #333333;\n            padding: 2rem;\n            border-radius: 30px;\n            border: 1px solid rgba(255,255,255,0.2);\n        }\n        \n        .services-grid {\n            display: grid;\n            grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));\n            gap: 2rem;\n            margin-top: 2rem;\n        }\n        \n        .service-card {\n            background: #fff;\n            border-radius: 20px;\n            padding: 2rem;\n            position: relative;\n            min-height: 400px;\n            display: flex;\n            flex-direction: column;\n        }\n        \n        .service-card.light {\n            background: #f5f5f5;\n        }\n        \n        .service-card.light .service-title {\n            color: #000;\n        }\n        \n        .service-card.light .feature-item {\n            background: rgba(0,0,0,0.08);\n            color: #000;\n            border: 1px solid rgba(0,0,0,0.1);\n        }\n        \n        .service-card.light .feature-item:hover {\n            background: rgba(0,0,0,0.12);\n        }\n        \n        .service-card.light .service-number {\n            color: #000;\n            background: rgba(0,0,0,0.1);\n        }\n        \n        .service-card.dark {\n            background: #000;\n            color: white;\n        }\n        \n        .service-card.dark .feature-item {\n            background: #333;\n            border: 1px solid rgba(255,255,255,0.2);\n        }\n        \n        .service-card.dark .feature-item:hover {\n            background: #444;\n        }\n        \n        .service-card.green {\n            background: #004D40;\n            color: white;\n        }\n        \n        .service-card.green .feature-item {\n            background: rgba(255,255,255,0.15);\n            border: 1px solid rgba(255,255,255,0.2);\n        }\n        \n        .service-card.green .feature-item:hover {\n            background: rgba(255,255,255,0.25);\n        }\n        \n        .service-number {\n            position: absolute;\n            top: 1rem;\n            right: 1rem;\n            padding: 0.5rem 1rem;\n            border-radius: 20px;\n            font-size: 0.9rem;\n            background: rgba(255,255,255,0.1);\n            color: inherit;\n        }\n        \n        .service-title {\n            font-size: 2rem;\n            font-weight: 800;\n            margin-bottom: 2rem;\n            color: inherit;\n            letter-spacing: 1px;\n        }\n        \n        .service-features {\n            display: flex;\n            flex-direction: column;\n            gap: 1rem;\n            margin-top: auto;\n        }\n        \n        .feature-item {\n            padding: 0.8rem 1.5rem;\n            border-radius: 30px;\n            font-size: 0.9rem;\n            transition: all 0.3s ease;\n            font-weight: 600;\n            letter-spacing: 0.5px;\n        }\n        \n        .dot-pattern {\n            position: absolute;\n            top: 1rem;\n            right: 1rem;\n            opacity: 0.1;\n        }\n        \n        @media (max-width: 768px) {\
